INSERT INTO `game_rules` (`id`, `name`, `description`, `rulestring`, `type`, `link`, `sort`, `created`, `modified`)
VALUES
	(1,'Conway\'s Game of Life','The original','3/23','chaotic','http://www.conwaylife.com/wiki/Conway%27s_Game_of_Life',1,'2012-12-15 14:31:01','2012-12-15 21:39:05'),
	(2,'Gnarl','A simple exploding rule that forms complex patterns from even a single live cell.','1/1','explosive','',9,'2012-12-15 20:38:32','2012-12-15 21:39:05'),
	(3,'Replicator','A rule in which every pattern is a replicator.','1357/1357','explosive','http://www.conwaylife.com/wiki/Replicator_(CA)',2,'2012-12-15 20:38:32','2012-12-15 21:39:05'),
	(4,'Fredkin','A rule in which, like Replicator, every pattern is a replicator.','02468/1357','explosive','http://www.conwaylife.com/wiki/Fredkin',9,'2012-12-15 20:38:32','2012-12-15 21:39:05'),
	(5,'Seeds','An exploding rule in which every cell dies in every generation. It has many simple orthogonal spaceships, though it is in general difficult to create patterns that don\'t explode.','/2','explosive','http://www.conwaylife.com/wiki/Seeds',9,'2012-12-15 20:38:32','2012-12-15 21:39:05'),
	(6,'Live Free or Die','An exploding rule in which only cells with no neighbors survive. It has many spaceships, puffers, and oscillators, some of infinitely extensible size and period.','0/2','explosive','http://www.conwaylife.com/wiki/Live_Free_or_Die',9,'2012-12-15 20:38:32','2012-12-15 21:39:05'),
	(7,'Serviettes','An exploding rule in which every cell dies every generation (like seeds). This rule is of interest because of the fabric-like beauty of the patterns that it produces.','/234','explosive','',9,'2012-12-15 20:38:32','2012-12-15 21:39:05'),
	(8,'DotLife','An exploding rule closely related to Conway\'s Life. The B-heptomino is a common infinite growth pattern in this rule, though it can be stabilized into a spaceship.','023/3','explosive','',8,'2012-12-15 20:38:32','2012-12-15 21:39:05'),
	(9,'Life without death','An expanding rule that produces complex flakes. It also has important ladder patterns.','012345678/3','expansive','http://www.conwaylife.com/wiki/Life_without_death',7,'2012-12-15 20:38:32','2012-12-15 21:39:05'),
	(10,'Mazectric','An expanding rule that crystalizes to form maze-like designs that tend to be straighter (ie. have longer \"halls\") than the standard maze rule.','1234/3','expansive','http://www.conwaylife.com/wiki/Mazectric',9,'2012-12-15 20:38:32','2012-12-15 21:39:05'),
	(11,'Maze','An expanding rule that crystalizes to form maze-like designs.','12345/3','expansive','http://www.conwaylife.com/wiki/Maze',6,'2012-12-15 20:38:32','2012-12-15 21:39:05'),
	(12,'Coral','An exploding rule in which patterns grow slowly and form coral-like textures.','45678/3','explosive','',9,'2012-12-15 20:38:32','2012-12-15 21:39:05'),
	(13,'34 Life','An exploding rule that was initially thought to be a stable alternative to Conway\'s Life, until computer simulation found that most patterns tend to explode. It has many small oscillators and simple p','34/34','explosive','',9,'2012-12-15 20:38:32','2012-12-15 21:39:05'),
	(14,'Assimilation','A very stable rule that forms permanent diamond-shaped patterns with partially filled interiors.','4567/345','stable','',8,'2012-12-15 20:38:32','2012-12-15 21:39:05'),
	(15,'Long Life','A stable rule that gets its name from the fact that it has many simple extremely high period oscillators.','5/345','stable','',9,'2012-12-15 20:38:32','2012-12-15 21:39:05'),
	(16,'Diamoeba','A chaotic pattern that forms large diamonds with chaotically oscillating boundaries. Known to have quadratically-growing patterns.','5678/35678','chaotic','',9,'2012-12-15 20:38:32','2012-12-15 21:39:05'),
	(17,'Amoeba','A chaotic rule that is well balanced between life and death; it forms patterns with chaotic interiors and wildly moving boundaries.','1358/357','chaotic','',9,'2012-12-15 20:38:32','2012-12-15 21:39:05'),
	(18,'Pseudo Life','A chaotic rule with evolution that resembles Conway\'s Life, but few patterns from Life work in this rule because the glider is unstable.','238/357','chaotic','',9,'2012-12-15 20:38:32','2012-12-15 21:39:05'),
	(19,'2x2','A chaotic rule with many simple still lifes, oscillators and spaceships. Its name comes from the fact that it sends patterns made up of 2x2 blocks to patterns made up of 2x2 blocks.','125/36','chaotic','http://www.conwaylife.com/wiki/2x2',9,'2012-12-15 20:38:32','2012-12-15 21:39:05'),
	(20,'HighLife','A chaotic rule very similar to Conway\'s Life that is of interest because it has a simple replicator.','23/36','chaotic','http://www.conwaylife.com/wiki/HighLife',3,'2012-12-15 20:38:32','2012-12-15 21:39:05'),
	(21,'Move','A rule in which random patterns tend to stabilize extremely quickly. Has a very common slow-moving spaceship and slow-moving puffer.','245/368','stable','http://www.conwaylife.com/wiki/Move',9,'2012-12-15 20:38:32','2012-12-15 21:39:05'),
	(22,'Stains','A stable rule in which most patterns tend to \"fill in\" bounded regions. Most nearby rules (such as coagulations) tend to explode.','235678/3678','stable','',9,'2012-12-15 20:38:32','2012-12-15 21:39:05'),
	(23,'Day & Night','A stable rule that is symmetric under on-off reversal. Many patterns exhibiting highly complex behavior have been found for it.','34678/3678','stable','http://www.conwaylife.com/wiki/Day_%26_Night',7,'2012-12-15 20:38:32','2012-12-15 21:39:05'),
	(24,'DryLife','An exploding rule closely related to Conway\'s Life, named after the fact that the standard spaceships bigger than the glider do not function in the rule. Has a small puffer based on the R-pentomino, w','23/37','explosive','',4,'2012-12-15 20:38:32','2012-12-15 21:39:05'),
	(25,'Coagulations','An exploding rule in which patterns tend to expand forever, producing a thick \"goo\" as it does so.','235678/378','explosive','',9,'2012-12-15 20:38:32','2012-12-15 21:39:05'),
	(26,'Walled cities','A stable rule that forms centers of pseudo-random activity separated by walls.','2345/45678','stable','',9,'2012-12-15 20:38:32','2012-12-15 21:39:05'),
	(27,'Vote 4/5','A modification of the standard Gérard Vichniac voting rule, also known as \"Anneal\", used as a model for majority voting.','35678/4678','stable','',10,'2012-12-15 20:38:32','2012-12-15 21:39:05'),
	(28,'Vote','Standard Gérard Vichniac voting rule, also known as \"Majority\", used as a model for majority voting.','45678/5678','stable','',9,'2012-12-15 20:38:32','2012-12-15 21:39:05');
INSERT INTO `game_shape_categories` (`id`, `name`, `description`, `link`, `created`, `modified`)
VALUES
	(1,'Agars','An agar is a pattern that can tile the Life universe periodically both in space and in time.','http://www.conwaylife.com/wiki/Category:Agars','2012-12-15 20:52:20','2012-12-15 21:39:10'),
	(2,'Gardens_of_Eden','A Garden of Eden is a pattern that has no parents and thus can only occur in generation 0.','http://www.conwaylife.com/wiki/Category:Gardens_of_Eden','2012-12-15 20:52:20','2012-12-15 21:39:10'),
	(3,'Guns','A gun is a stationary pattern that emits spaceships (or rakes) repeatedly forever.','http://www.conwaylife.com/wiki/Category:Guns','2012-12-15 20:52:20','2012-12-15 21:39:10'),
	(4,'Methuselahs','A methuselah is a pattern that takes a large number of generations in order to stabilize (known as its lifespan) and becomes much larger than its initial configuration at some point during its evoluti','http://www.conwaylife.com/wiki/Category:Methuselahs','2012-12-15 20:52:20','2012-12-15 21:39:10'),
	(5,'Oscillators','An oscillator is a pattern that is a predecessor of itself. That is, it is a pattern that repeats itself after a fixed number of generations (known as its period). ','http://www.conwaylife.com/wiki/Category:Oscillators','2012-12-15 20:52:20','2012-12-15 21:39:10'),
	(6,'Puffers','A puffer is a pattern that moves like a spaceship but leaves debris behind as it moves. ','http://www.conwaylife.com/wiki/Category:Puffers','2012-12-15 20:52:20','2012-12-15 21:39:10'),
	(7,'Sawtooths','A sawtooth is a finite pattern whose population grows without bound but does not tend to infinity. In other words, it is a pattern with population that reaches new heights infinitely often, but also i','http://www.conwaylife.com/wiki/Category:Sawtooths','2012-12-15 20:52:20','2012-12-15 21:39:10'),
	(8,'Spaceships','A spaceship is a finite pattern that reappears (without additions or losses) after a fixed number of generations displaced by a non-zero amount. ','http://www.conwaylife.com/wiki/Category:Spaceships','2012-12-15 20:52:20','2012-12-15 21:39:10'),
	(9,'Still_lifes','A still life is a pattern that does not change from one generation to the next, and thus is a parent of itself. ','http://www.conwaylife.com/wiki/Category:Still_lifes','2012-12-15 20:52:20','2012-12-15 21:39:10'),
	(10,'Wicks','A wick is a static or oscillating linearly repeating pattern that can be made to burn at one end. ','http://www.conwaylife.com/wiki/Category:Wicks','2012-12-15 20:52:20','2012-12-15 21:39:10'),
	(11,'Other','',NULL,'2012-12-15 20:52:20','2012-12-15 21:39:10');
